import React from "react";

const Menu = () => {
    return (
        <>
        <NavLink to = "./contact">Contact</NavLink>
        <NavLink to = "./service"></NavLink>
        <NavLink to = "./about"></NavLink>
        </>
    );
}

export default Menu;
